  Department of Veterans Affairs (CHAMPVA) is a health care benefit program designed
  for the dependents of certain Veterans. Administered by the Health Administration
  Center (HAC), Denver, Colorado, CHAMPVA shares the cost of necessary health care
  services and supplies with eligible beneficiaries. The CHAMPVA Eligibility & Payment
  Functions (CVA) database is used by HAC for the administration of the CHAMPVA program.\",\n\t\"license_title\":
